import React, { Component } from "react";
import MNavbar from "../Components/MNavbar.js";
import Footer from "../Components/Footer.js";
import Table1 from "../Components/Table1.js";
import Login from "../Components/Login.js";
import personNotes from "../assets/personNotes.jpg";
import { Row, Col } from "reactstrap";
import "./Home.css";

export default class Home extends Component {
  render() {
    return (
      <div>
        <MNavbar />
        <div className="container">
          <h2>Welcome to NoteFinder at NDNU!</h2>
          <div className="Logo">
            <Row className="">
              <Col xs="4">
                <img src={personNotes} width="500" height="150" />
              </Col>
            </Row>
          </div>
          <Login />

          <Footer />
        </div>
      </div>
    );
  }
}
